import React, { useState } from 'react';
import 'Styles/login.css'; // Importa o arquivo CSS

function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (event) => {
    event.preventDefault();
    // Aqui você pode adicionar a lógica para fazer a autenticação com seu backend
    console.log(`Email: ${email}, Password: ${password}`);
  }

  return (
    <div className="login-container"> {/* Aplica a classe CSS aqui */}
      <h1>Login</h1>
      <form className="login-form" onSubmit={handleSubmit}> {/* Aplica a classe CSS aqui */}
        <label>
          Email:
          <input type="email" value={email} onChange={(e) => setEmail(e.target.value)} />
        </label>
        <label>
          Password:
          <input type="password" value={password} onChange={(e) => setPassword(e.target.value)} />
        </label>
        <button type="submit">Login</button>
      </form>
    </div>
  );
}

export default Login;
